import { GET_STUDENTS } from "../actions/action-types";

const initialState = {
  students: [],
  student: {},
};

export default function (state = initialState, action) {
  switch (action.type) {
    case GET_STUDENTS:
      return Object.assign({}, ...state, {
        students: action.payload,
      });
    default:
      return state;
  }
}
